import { Dialog, TextField, Typography ,Box, FormLabel,Button} from '@mui/material'
import React from 'react';
import CloseRoundedIcon from '@mui/icons-material/CloseRounded';
import IconButton from '@mui/material';


const AuthForm = () => {
  return (
    <Dialog open= {true}>

        <Box sx={{ml:"auto" , padding:1}}>
            <IconButton>CloseRounded</IconButton>
        </Box>
        <Typography sx={{mt:1 ,mb:1}} variant="h4" textAlign={"center"}>
         Login
        </Typography>
        <form>
        <Box
          padding={6}
          display={"flex"}
          justifyContent={"center"}
          flexDirection="column"
          width={400}
          margin="auto"
          alignContent={"center"}
        >

            <FormLabel sx={{mt:1 ,mb:1}}>Name</FormLabel>
            <TextField  margin='normal' variant="standard" type="text" name='name'/>
            <FormLabel sx={{mt:1 ,mb:1}}>Email</FormLabel>
            <TextField  margin='normal' variant="standard" type="email" name='email'/>
            <FormLabel sx={{mt:1 ,mb:1}}>Password</FormLabel>
            <TextField  margin='normal' variant="standard" type="password" name='password'/>

            <Button
            sx={{ mt: 2, borderRadius: 10, bgcolor: "#2b2d42" }}
            type="submit"
            fullWidth
            variant="contained">Login</Button>

              <Button
            sx={{ mt: 2, borderRadius: 10 }}
            fullWidth
            >Switch</Button>
        </Box>
        </form>
    </Dialog>
  )
}

export default AuthForm
